window.bookSummaryJSON = "<p><b>Love wasn't something that I ever felt before.</b></p> <p>I knew how to love because I loved my Yaya more than life. I knew that I could love because of the baby I had grown within me and now held; I loved her more than I loved myself. As I watched this man sleep peacefully beside me, one arm around me, keeping me close, I knew that I loved him. I knew that I could see forever with him, and I knew that he would kill any and everything moving when it came to protecting me.</p>"; 
